import React from 'react'

const Home = () => {
    return (
        <React.Fragment>
        <nav class="navbar navbar-light bg-light">
            <a class="navbar-brand" href="#">
                <div className="logo">SmartCode</div>
            </a>
        </nav>
        </React.Fragment>
    )
}

export default Home.component
